                                "attributedDescription": {
                                    "content": "I'm offering early access to my program as I develop the lessons, watch the video here to see if it's a good fit: https://www.skool.com/learn-by-leo-pr...\n_________________________________________________________________________\nMUST-HAVE tool I use for researching my audience and getting ideas: https://velio.co/learn-by-leo/?utm_me...\n\nWith my link, you get a 1-hour video I made explaining what it takes to get views on YouTube\n______________________________________________________________________\nFREE ASSETS\nhttps://drive.google.com/drive/folder... \n_________________________________________________________________________\nTUTORIALS TO GET STARTED EDITING LIKE ME\n1. Find a good editing program. I use Premiere Pro and After Effects. Here are alternatives:    • Top 5 Video Editing Software in 2023 (Begi...   \n2. Watch a 30-60 min tutorial on the basics of your editing program (this is super important to do because if you know how to do a lot of effects, it will give you a ton of creative freedom) \n3. Learn how to animate with keyframes in your editing software\n4. Learn masking in your editing software\n5. Learn cool effects and get plugins. For example, I make some cool effects using the glow effect in After Effects or using Video Copilot’s Lightsaber plugin \n\n_________________________________________________________________________\nPROGRAMS I USE \n1. Adobe Premiere Pro, Adobe After Effects, Adobe Photoshop, Adobe Illustrator\n2. Envato Elements for stock assets and sound effects: https://1.envato.market/OrDKJQ \n3. Epidemic Sound for music and sound effects: https://share.epidemicsound.com/6qz3b5\n4. Steelseries GG sonar for AI background noise cancellation \n_________________________________________________________________________\nHARDWARE I USE \nElgato cam link: https://amzn.to/4cFa6Pa\nSony ZV E10: https://amzn.to/4g6LYrs\nRode NT USB+: https://amzn.to/4cT35KU\nMain light: https://amzn.to/4cQFCd4\n\n(Some links are affiliate links, so I get paid when you use them, with no extra cost to you.)\n\n\nThis video teaches how to edit YouTube videos faster and edit videos better. It explores the retention editing myths about editing style, then explains how to get better editing skills. Video editing is an important part of getting more views on YouTube, so this is a helpful video to watch to grow on YouTube. \n\n\n0:00 intro\n0:25 the hard truth\n2:29 healthy variety of visuals\n8:36 visual continuity \n10:29 immersive audio",

                                "attributedDescriptionBodyText": {
                                    "content": "I'm offering early access to my program as I develop the lessons, watch the video here to see if it's a good fit: https://www.skool.com/learn-by-leo-pr...\n_________________________________________________________________________\nMUST-HAVE tool I use for researching my audience and getting ideas: https://velio.co/learn-by-leo/?utm_me...\n\nWith my link, you get a 1-hour video I made explaining what it takes to get views on YouTube\n______________________________________________________________________\nFREE ASSETS\nhttps://drive.google.com/drive/folder... \n_________________________________________________________________________\nTUTORIALS TO GET STARTED EDITING LIKE ME\n1. Find a good editing program. I use Premiere Pro and After Effects. Here are alternatives:    • Top 5 Video Editing Software in 2023 (Begi...   \n2. Watch a 30-60 min tutorial on the basics of your editing program (this is super important to do because if you know how to do a lot of effects, it will give you a ton of creative freedom) \n3. Learn how to animate with keyframes in your editing software\n4. Learn masking in your editing software\n5. Learn cool effects and get plugins. For example, I make some cool effects using the glow effect in After Effects or using Video Copilot’s Lightsaber plugin \n\n_________________________________________________________________________\nPROGRAMS I USE \n1. Adobe Premiere Pro, Adobe After Effects, Adobe Photoshop, Adobe Illustrator\n2. Envato Elements for stock assets and sound effects: https://1.envato.market/OrDKJQ \n3. Epidemic Sound for music and sound effects: https://share.epidemicsound.com/6qz3b5\n4. Steelseries GG sonar for AI background noise cancellation \n_________________________________________________________________________\nHARDWARE I USE \nElgato cam link: https://amzn.to/4cFa6Pa\nSony ZV E10: https://amzn.to/4g6LYrs\nRode NT USB+: https://amzn.to/4cT35KU\nMain light: https://amzn.to/4cQFCd4\n\n(Some links are affiliate links, so I get paid when you use them, with no extra cost to you.)\n\n\nThis video teaches how to edit YouTube videos faster and edit videos better. It explores the retention editing myths about editing style, then explains how to get better editing skills. Video editing is an important part of getting more views on YouTube, so this is a helpful video to watch to grow on YouTube. \n\n\n0:00 intro\n0:25 the hard truth\n2:29 healthy variety of visuals\n8:36 visual continuity \n10:29 immersive audio",
